import './Expenses.css';
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  const items = props.items;

  return (
    <div className='expenses'>
      <ExpenseItem {...items[0]} />
      <ExpenseItem {...items[1]} />
      <ExpenseItem {...items[2]} />
      <ExpenseItem {...items[3]} />
    </div>
  );
}

export default Expenses;
